import React from "react";
import StockContainer from "./StockContainer";
import PortfolioContainer from "./PortfolioContainer";
// import SearchBar from "./SearchBar";

function TestLineContainer() {
  return (
    <div>
      {/* <SearchBar /> */}
      <div className="row">
        <div className="col-8">
          <StockContainer />
        </div>
        <div className="col-4">
          <PortfolioContainer />
        </div>
      </div>
    </div>
  );
}

export default TestLineContainer;
